import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import Badge from '@mui/material/Badge';
import { styled } from '@mui/material/styles';
import '/style.css';

const StyledBadge = styled(Badge)(({ theme }) => ({
  '& .MuiBadge-badge': {
    right: -3,
    top: 13,
    border: `2px solid ${theme.palette.background.paper}`,
    padding: '0 4px',
  },
}));

function Navbar() {

    return (
        <nav className="p-3 d-flex align-items-center">
            <div className=" col-xs-12 col-sm-6 text-nowrap pt-1">
                <Link className=" mx-3" to="/">
                    <img src="../Gi.png" alt="<Logo>" className="nav-logo" />
                </Link>
                <Link className="nav-tab mx-3" to="/">Home</Link>
                <Link className="nav-tab mx-3 text-nowrap" to="/about">About Me</Link>
            </div>

            <div className=" col-xs-12 col-sm-6 d-flex justify-content-end align-items-center">
                <React.Fragment>
                    <Link className="nav-tab mx-3" to="/projects">Projects</Link>
                </React.Fragment>
            </div>
        </nav>
    );
}

export default Navbar;
